import { UserRepositoryInMemory } from 'src/modules/user/repositories/UserRepositoryInMemory';
import { OcrRepositoryInMemory } from '../repositories/OcrRepositoryInMemory';
import { CreateOcrUseCase } from './CreateOcrUseCase';
import { SaveOcrUseCase } from './SaveOcrUseCase';
import { makeUser } from 'src/modules/user/factories/userFactory';
import { UserNotExistsException } from '../exceptions/UserNotExistsException';

let createOcrUseCase: CreateOcrUseCase;
let saveOcrUseCase: SaveOcrUseCase;
let ocrRepositoryInMemory: OcrRepositoryInMemory;
let userRepositoryInMemory: UserRepositoryInMemory;

const image =
  '';

//const imageType = 'image/jpeg';

describe('Extract text from image', () => {
  beforeEach(() => {
    createOcrUseCase = new CreateOcrUseCase();
    ocrRepositoryInMemory = new OcrRepositoryInMemory();
    userRepositoryInMemory = new UserRepositoryInMemory();
    saveOcrUseCase = new SaveOcrUseCase(
      ocrRepositoryInMemory,
      userRepositoryInMemory,
    );
  });

  it('should be able to return the extracted text', async () => {
    const text = await createOcrUseCase.execute(image);
    expect(typeof text).toBe('string');
  }, 10000);

  it('should be able to create a ocr in database', async () => {
    expect(ocrRepositoryInMemory.ocrs).toEqual([]);
    expect(userRepositoryInMemory.users).toEqual([]);

    const user = makeUser({});

    userRepositoryInMemory.users = [user];

    expect(userRepositoryInMemory.users).toEqual([user]);

    const ocr = await saveOcrUseCase.execute({
      image: image,
      userId: user.id,
    });

    expect(ocrRepositoryInMemory.ocrs).toEqual([ocr]);
  });

  it('should be able to throw error if user not exists', async () => {
    expect(ocrRepositoryInMemory.ocrs).toEqual([]);

    expect(async () => {
      await saveOcrUseCase.execute({
        image: image,
        userId: '',
      });
    }).rejects.toThrow(UserNotExistsException);
  });
});
